import React from "react";
import "./App.css";
import {BrowserRouter, Route} from "react-router-dom";
import Table from "./components/Table";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div>
          <Table props={"Country"} />
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
